// src/pages/Portfolio.jsx
import React, { useState } from 'react';
import { FaCode, FaCertificate, FaTools } from 'react-icons/fa';
import { 
  SiReact, 
  SiNodedotjs, 
  SiFirebase, 
  SiHtml5, 
  SiCss3,
  SiJavascript
} from 'react-icons/si';

const Portfolio = () => {
  const [activeTab, setActiveTab] = useState('projects');

  const projects = [
    {
      title: 'Aritmatika Solver',
      description: 'A powerful math engine for solving complex mathematical expressions, simplifying equations, and visualizing mathematical graphs.',
      image: '/images/aritmatika.png', // Make sure to add these images to your public folder
      technologies: ['React', 'Node.js', 'Express', 'Mathematics API'],
    },
    {
      title: 'Auto-Chat-Discord',
      description: 'An intelligent Discord bot powered by AI, featuring smart commands, auto-moderation, and interactive features for server management.',
      image: '/images/discord-bot.png',
      technologies: ['Discord.js', 'Node.js', 'OpenAI API', 'MongoDB'],
    },
  ];

  const certificates = [
    { 
      title: 'AWS Certified Cloud Practitioner',
      description: 'Comprehensive understanding of AWS Cloud concepts, services, and deployment patterns.',
      issuer: 'Amazon Web Services',
      date: '2023'
    },
    { 
      title: 'Google Machine Learning Certification',
      description: 'Advanced machine learning concepts and practical implementation using TensorFlow.',
      issuer: 'Google',
      date: '2023'
    },
    { 
      title: 'Meta Frontend Development',
      description: 'Modern frontend development practices and frameworks.',
      issuer: 'Meta',
      date: '2023'
    }
  ];

  const skills = [
    { name: 'React.js', icon: <SiReact className="text-[#61DAFB]" size={40} /> },
    { name: 'Node.js', icon: <SiNodedotjs className="text-[#339933]" size={40} /> },
    { name: 'Firebase', icon: <SiFirebase className="text-[#FFCA28]" size={40} /> },
    { name: 'HTML5', icon: <SiHtml5 className="text-[#E34F26]" size={40} /> },
    { name: 'CSS3', icon: <SiCss3 className="text-[#1572B6]" size={40} /> },
    { name: 'JavaScript', icon: <SiJavascript className="text-[#F7DF1E]" size={40} /> },
  ];

  return (
    <section id="portfolio" className="bg-gradient-to-b from-[#0a0014] to-[#130029] text-white py-16 px-6 md:px-20">
      <h2 className="text-4xl font-bold text-center mb-2">
        <span className="text-white">Portfolio </span>
        <span className="bg-gradient-to-r from-pink-500 to-purple-500 bg-clip-text text-transparent">Showcase</span>
      </h2>
      <p className="text-center text-gray-400 mb-12 max-w-2xl mx-auto">
        Explore My Journey through Projects, Certificates, and Technical Expertise. Each Section Represents a Milestone in My Continuous Learning Path.
      </p>

      {/* Navigation Tabs */}
      <div className="flex flex-wrap justify-center gap-4 mb-12">
        <button
          onClick={() => setActiveTab('projects')}
          className={`px-6 py-2 rounded-full font-semibold transition-all duration-300 ${
            activeTab === 'projects' 
              ? 'bg-gradient-to-r from-pink-500 to-purple-500 text-white' 
              : 'border border-white/20 hover:border-pink-500'
          }`}
        >
          <FaCode className="inline mr-2" /> Projects
        </button>
        <button
          onClick={() => setActiveTab('certificates')}
          className={`px-6 py-2 rounded-full font-semibold transition-all duration-300 ${
            activeTab === 'certificates'
              ? 'bg-gradient-to-r from-pink-500 to-purple-500 text-white'
              : 'border border-white/20 hover:border-pink-500'
          }`}
        >
          <FaCertificate className="inline mr-2" /> Certificates
        </button>
        <button
          onClick={() => setActiveTab('skills')}
          className={`px-6 py-2 rounded-full font-semibold transition-all duration-300 ${
            activeTab === 'skills'
              ? 'bg-gradient-to-r from-pink-500 to-purple-500 text-white'
              : 'border border-white/20 hover:border-pink-500'
          }`}
        >
          <FaTools className="inline mr-2" /> My Skills
        </button>
      </div>

      {/* Content Sections */}
      <div className="max-w-7xl mx-auto">
        {activeTab === 'projects' && (
          <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
            {projects.map((project, i) => (
              <div 
                key={i} 
                className="group bg-[#1c1b2e]/50 backdrop-blur-sm p-6 rounded-xl shadow-lg hover:shadow-pink-500/20 transition-all duration-300"
              >
                <div className="relative overflow-hidden rounded-lg mb-6">
                  <img 
                    src={project.image} 
                    alt={project.title} 
                    className="w-full h-64 object-cover transform group-hover:scale-105 transition-transform duration-300" 
                  />
                  <div className="absolute inset-0 bg-gradient-to-t from-[#1c1b2e] opacity-60" />
                </div>
                <h3 className="text-2xl font-bold mb-3 bg-gradient-to-r from-pink-500 to-purple-500 bg-clip-text text-transparent">
                  {project.title}
                </h3>
                <p className="text-gray-300 mb-4">{project.description}</p>
                <div className="flex flex-wrap gap-2">
                  {project.technologies.map((tech, index) => (
                    <span 
                      key={index}
                      className="text-sm px-3 py-1 rounded-full bg-pink-500/10 text-pink-400 border border-pink-500/20"
                    >
                      {tech}
                    </span>
                  ))}
                </div>
              </div>
            ))}
          </div>
        )}

        {activeTab === 'certificates' && (
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
            {certificates.map((cert, i) => (
              <div 
                key={i} 
                className="bg-[#1c1b2e]/50 backdrop-blur-sm p-6 rounded-xl shadow-lg hover:shadow-pink-500/20 transition-all duration-300"
              >
                <h3 className="text-xl font-bold mb-3 bg-gradient-to-r from-pink-500 to-purple-500 bg-clip-text text-transparent">
                  {cert.title}
                </h3>
                <p className="text-gray-300 mb-4">{cert.description}</p>
                <div className="flex justify-between text-sm text-gray-400">
                  <span>{cert.issuer}</span>
                  <span>{cert.date}</span>
                </div>
              </div>
            ))}
          </div>
        )}

        {activeTab === 'skills' && (
          <div className="text-center">
            <div className="grid grid-cols-2 sm:grid-cols-3 md:grid-cols-6 gap-8 mt-8">
              {skills.map((skill, i) => (
                <div 
                  key={i} 
                  className="flex flex-col items-center gap-3 p-4 rounded-xl bg-[#1c1b2e]/50 backdrop-blur-sm hover:shadow-lg hover:shadow-pink-500/20 transition-all duration-300"
                >
                  {skill.icon}
                  <span className="text-gray-300">{skill.name}</span>
                </div>
              ))}
            </div>
          </div>
        )}
      </div>
    </section>
  );
};

export default Portfolio;
